import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Search';
import Search from './Search';
import unsplash from '../apis/unsplash/unsplash'

class Header extends Component {

    onFormSubmit=(searchValue)=>{

        unsplash.get('/search/photos' ,{
            params :{
                        query : searchValue,
                    }

           }).then((res)=>{

                console.log(res)
           })
    }

    render() {
        return (
            <header className="header">
            <div className="container">
                <div className="row">
                    <div className="col-lg-4 my-auto">
                        <a href="/" className="logo">PhotoShowcase</a>
                    </div>
                    <div className="col-lg-4 my-auto text-center">
                        <div className="mainmenu">
                            <ul>
                                <li><Link to='/'>Home </Link></li>
                                 <li><Link to='/about'>About </Link></li>
                                <li><Link to="/disclaimer">Disclaimer</Link></li>
                            </ul>
                        </div>
                    </div>
                    <div className="col-lg-4 my-auto text-right">
                        <Search onFormSubmit={this.onFormSubmit}/>
                    </div>
                </div>
            </div>
        </header>
        );
    }
}

export default Header;
